{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/piotrpowroznik/geothermal-model?scriptVersionId=266442289\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"7aedc499","metadata":{"papermill":{"duration":0.004229,"end_time":"2025-10-07T21:54:40.550664","exception":false,"start_time":"2025-10-07T21:54:40.546435","status":"completed"},"tags":[]},"source":["# Geothermal Model\n","\n","Geothermal model simulation of heat distribution in grid 200x200 with nodes spaced 5 meters apart. Model consists of:\n","* Background with a thermal diffusivity equal to 0.001 and 3 randomly located ore bodies with a diameter of 100 meters and thermal diffusivity 0.01\n","* The temperature at the depth of 1000 meters is constant and equal to 50 Celsius degrees.\n","* The temperature on the surface is constant and equal to 0 Celsius degrees\n","* For boundary conditions zero-gradient boundary condition was applied\n","* Stability condition is determined by following inequality:\n","  $$\n","    |1-\\frac{L_{new}}{L_{old}}| < 0.0001\n","  $$\n","\n","Variant of the thermal conductivity equation for use in the task:\n","$$\n","T_{i,j}^{k+1} = (1-\\frac{4\\Delta t \\alpha}{h^2})T_{i,j}^k + \\Delta t \\alpha(\\frac{T_{i,j-1}^k + T_{i-1,j}^k + T_{i+1,j}^k+ T_{i,j+1}^k}{h^2})\n","$$\n","$$\n","\\Delta t \\leqslant \\frac{h^2}{4\\alpha}\n","$$\n"]},{"cell_type":"code","execution_count":1,"id":"ccd8efe4","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:40.562971Z","iopub.status.busy":"2025-10-07T21:54:40.560698Z","iopub.status.idle":"2025-10-07T21:54:40.797815Z","shell.execute_reply":"2025-10-07T21:54:40.79583Z"},"papermill":{"duration":0.24626,"end_time":"2025-10-07T21:54:40.800602","exception":false,"start_time":"2025-10-07T21:54:40.554342","status":"completed"},"tags":[]},"outputs":[],"source":["library(animation)\n","library(plotrix)\n","library(IRdisplay)"]},{"cell_type":"markdown","id":"dba6f518","metadata":{"papermill":{"duration":0.003319,"end_time":"2025-10-07T21:54:40.807409","exception":false,"start_time":"2025-10-07T21:54:40.80409","status":"completed"},"tags":[]},"source":["## Initial Conditions"]},{"cell_type":"code","execution_count":2,"id":"ebe9448f","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:40.852945Z","iopub.status.busy":"2025-10-07T21:54:40.816076Z","iopub.status.idle":"2025-10-07T21:54:40.880843Z","shell.execute_reply":"2025-10-07T21:54:40.878859Z"},"papermill":{"duration":0.073048,"end_time":"2025-10-07T21:54:40.883724","exception":false,"start_time":"2025-10-07T21:54:40.810676","status":"completed"},"tags":[]},"outputs":[],"source":["# Start measuring execution time\n","start <- Sys.time()\n","\n","# Grid size\n","N <- 200\n","\n","# Spatial step size\n","h <- 5\n","\n","# Radius of circular objects\n","r <- 20\n","\n","# Number of circles\n","circles <- 3\n","\n","# Stability check flag\n","stable_flag <- 0\n","\n","# Initialize matrices for new and previous time steps\n","Lnew <- matrix(nrow = N, ncol = N, 0)\n","L <- matrix(nrow = N, ncol = N, 0)"]},{"cell_type":"code","execution_count":3,"id":"acb1972f","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:40.894943Z","iopub.status.busy":"2025-10-07T21:54:40.893251Z","iopub.status.idle":"2025-10-07T21:54:40.907839Z","shell.execute_reply":"2025-10-07T21:54:40.905969Z"},"papermill":{"duration":0.023549,"end_time":"2025-10-07T21:54:40.910715","exception":false,"start_time":"2025-10-07T21:54:40.887166","status":"completed"},"tags":[]},"outputs":[],"source":["# Function to draw circles in the grid\n","draw_Circle <- function(a, x_center, y_center, r) {\n","  for (x in (x_center - r):(x_center + r)) {\n","    for (y in (y_center - r):(y_center + r)) {\n","      if (x >= 0 && x <= N && y >= 0 && y <= N) {\n","        if (((x - x_center)^2 + (y - y_center)^2) <= r^2) {\n","          a[x, y] <- 0.01\n","        }\n","      }\n","    }\n","  }\n","  return(a)\n","}"]},{"cell_type":"code","execution_count":4,"id":"6af1a86e","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:40.923013Z","iopub.status.busy":"2025-10-07T21:54:40.921254Z","iopub.status.idle":"2025-10-07T21:54:40.97954Z","shell.execute_reply":"2025-10-07T21:54:40.977599Z"},"papermill":{"duration":0.066872,"end_time":"2025-10-07T21:54:40.982532","exception":false,"start_time":"2025-10-07T21:54:40.91566","status":"completed"},"tags":[]},"outputs":[],"source":["# Generate a 3-body model\n","a <- matrix(nrow = N, ncol = N, 0.002)\n","Center_positions <- c()\n","\n","for (i in 1:circles) {\n","  pos <- round(runif(2) * (N - 2 * r) + r)\n","  Center_positions <- c(Center_positions, pos[1], pos[2])\n","  a <- draw_Circle(a, pos[1], pos[2], r)\n","}\n"]},{"cell_type":"code","execution_count":5,"id":"9e8e0007","metadata":{"execution":{"iopub.execute_input":"2025-10-07T21:54:40.993103Z","iopub.status.busy":"2025-10-07T21:54:40.991456Z","iopub.status.idle":"2025-10-07T21:54:41.424002Z","shell.execute_reply":"2025-10-07T21:54:41.421003Z"},"papermill":{"duration":0.441711,"end_time":"2025-10-07T21:54:41.427646","exception":false,"start_time":"2025-10-07T21:54:40.985935","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nO3de5yVdYE/8OfMDDMM1+Gm3LwkizJqmhcazUtii2gFUpkuGqsWpolKrdaaqahb\npltpXoB1S/0pBq6umlRT7tpSjhfMTMRQXLyMlg4WdwRmBmbO7w+MRUR4HM7M+T7feb//8DWc\n+c55vpzndcYP38/zfU4un88nAABkX0mxJwAAQGEIdgAAkRDsAAAiIdgBAERCsAMAiIRgBwAQ\nCcEOACASgh0AQCQEOwCASAh2AACREOwAACIh2AEAREKwAwCIhGAHABAJwQ4AIBKCHQBAJAQ7\nAIBICHYAAJEQ7AAAIiHYAQBEQrADAIiEYAcAEAnBDgAgEoIdAEAkBDsAgEgIdgAAkRDsAAAi\nIdgBAERCsAMAiIRgBwAQCcEOACASgh0AQCQEOwCASAh2AACREOwAACIh2AEAREKwAwCIhGAH\nABAJwQ4AIBKCHQBAJAQ7AIBICHYAAJEQ7AAAIiHYAQBEQrADAIiEYAcAEAnBDgAgEoIdAEAk\nBDsAgEgIdgAAkRDsAAAiIdgBAERCsAMAiIRgBwAQCcEOACASgh0AQCQEO