_count <- -1\n","  \n","  # Time iteration loop\n","  for (k in 1:niter) {\n","    t <- t + dt\n","    \n","    # Update progress bar\n","    iteration_count <- iteration_count + 1\n","    setTxtProgressBar(prog_bar, iteration_count)\n","    \n","    # Update grid values\n","    for (i in 2:(N - 1)) {\n","      for (j in 2:(N - 1)) {\n","        Lnew[i, j] <- (1 - (4 * dt * a[i, j]) / (h^2)) * L[i, j] +\n","          dt * a[i, j] * ((L[i - 1, j] + L[i + 1, j] + L[i, j - 1] + L[i, j + 1]) / (h^2))\n","      }\n","    }\n","    \n","    # Simple zero-gradient boundary condition\n","    Lnew[, 1] <- L[, 2]\n","    Lnew[, N] <- L[, N - 1]\n","    \n","    # Move to the next iteration\n","    auxL <- L\n","    L <- Lnew\n","    \n","    # Check for stability\n","    if (stable_flag != 1) {\n","      if (abs(1 - (mean(Lnew) / mean(auxL))) < 0.0001) {\n","        print(paste0(\"Stability achieved at iteration: \", k))\n","        print(paste0(\"Corresponds to day: \", round((t / (3600 * 24)), 0)))\n","        stable_flag <- 1\n","      }\n","    }\n","    \n","    # Visualize every 100 iterations\n","    if (k %% 100 == 0) {\n","      Limg <- apply(L, 2, rev)\n","      image(t(Limg))\n","      \n","      # Display simulation time in days\n","      text(0.2, 0.9, round(t / (3600 * 24)))\n","      \n","      # Draw circles\n","      for (i in seq(1, 7, 2)) {\n","        draw.ellipse(1 - Center_positions[i] / 200, (Center_positions[i + 1] / 200), \n","                     a = 1 / (N / r), b = 1 / (N / r), nv = 100, lwd = 1, border = \"black\")\n","      }\n","      box()\n","    }\n","  }\n","}, interval = 0.1)\n","\n","# Stop measuring execution time\n","stop <- Sys.time()\n","\n","# Print execution time\n","stop - start\n"]},{"cell_type":"markdown","id":"85e87bd9","metadata":{"papermill":{"duration":0.027121,"end_time":"2025-10-07T22:06:53.498107","exception":false,"start_time":"2025-10-07T22:06:53.470986","status":"completed"},"tags":[]},"source":["## Results"]},{"cell_typ